import React, { Component } from "react";
import '../../App.css';
import Drawer from '@material-ui/core/Drawer';
import Divider from '@material-ui/core/Divider';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import * as drawerStyles from "../../styles/drawer";
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles({
    background: {
        background: "rgb(0, 56, 83)",
        color: "rgb(255,255,255)"
    }
  });
  const LeftDrawer = props => {

        const styles = useStyles();

        return (
            
            <Drawer style={drawerStyles.drawer} classes={{ paper: styles.background }} variant="permanent" anchor="left">
             
            <div style={drawerStyles.topItem}><center>
            <div>Real-Time Video Analytics</div>
            <div>for Threat Detection</div></center></div>
            <Divider />
              <List>
              {['Live Surveillance', 'Surveillance History', 'Daily Summary', 'Threat Analytics' , 'Settings' ,'Sign Out'].map((text, index) => (
                <ListItem style={drawerStyles.listItem} button key={text}>
                 {/*  <ListItemIcon>{index % 2 === 0 ? <InboxIcon /> : <MailIcon />}</ListItemIcon> */}
               {/*    <ListItemText style={drawerStyles.listitem} primary={text} /> */}
                  {text}
                </ListItem>
                 
              ))}
            
             </List>
   
           
             
            </Drawer> 
         
            

        );
    }



export default LeftDrawer;
